import React, { useState } from 'react';
import { TextField, Button, Typography, FormControl, InputLabel, Select, MenuItem } from '@mui/material';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';
import { useLocation } from 'react-router-dom';
import axios from 'axios';

const BookAppointment = () => {
  const [date, setDate] = useState(new Date());
  const [timeSlot, setTimeSlot] = useState('');
  const [medicalHistory, setMedicalHistory] = useState('');
  const [symptoms, setSymptoms] = useState('');
  const [timeSlotError, setTimeSlotError] = useState('');
  const [bookingError, setBookingError] = useState('');

  const location = useLocation();
  const { doctor } = location.state || {}; // Destructure the doctor from state

  const user = JSON.parse(localStorage.getItem('USER_INFO')); // Retrieve user info from local storage

  if (!doctor) {
    return <Typography variant="h6">No doctor details available.</Typography>;
  }

  const handleDateChange = (newValue) => setDate(newValue);

  const handleBookAppointment = async () => {
    if (!timeSlot) {
      setTimeSlotError('Select a time slot');
      return;
    }

    const appointmentDetails = {
      doctorId: doctor.id,
      doctorName: doctor.name,
      userId: user.id,
      userName: user.name,
      userEmailId: user.email,
      timeSlot: timeSlot,
      appointmentDate: date.toISOString().split('T')[0], // Format date as 'YYYY-MM-DD'
      symptoms: symptoms,
      priorMedicalHistory: medicalHistory
    };

    try {
      const response = await axios.post('http://localhost:8080/appointments', appointmentDetails);
      console.log('Appointment booked successfully:', response.data);
      // Handle success feedback here (e.g., show a success message or redirect)
    } catch (error) {
      console.error('Error booking appointment:', error);
      setBookingError('Failed to book appointment. Please try again.');
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <Typography variant="h4">Book an Appointment</Typography>
      <Typography variant="h6">Name: {doctor.name}</Typography>
      <LocalizationProvider dateAdapter={AdapterDateFns}>
        <DatePicker
          label="Date"
          value={date}
          onChange={handleDateChange}
          renderInput={(params) => <TextField {...params} fullWidth margin="normal" />}
        />
      </LocalizationProvider>
      <FormControl fullWidth margin="normal">
        <InputLabel>Time Slot</InputLabel>
        <Select
          value={timeSlot}
          onChange={(e) => {
            setTimeSlot(e.target.value);
            setTimeSlotError('');
          }}
        >
          <MenuItem value="10AM-11AM">10AM-11AM</MenuItem>
          <MenuItem value="11AM-12AM">11AM-12AM</MenuItem>
          <MenuItem value="12AM-01PM">12AM-01PM</MenuItem>
          <MenuItem value="05PM-06PM">05PM-06PM</MenuItem>
          <MenuItem value="06PM-07PM">06PM-07PM</MenuItem>
          <MenuItem value="07PM-08PM">07PM-08PM</MenuItem>
          <MenuItem value="08PM-09PM">08PM-09PM</MenuItem>
        </Select>
        {timeSlotError && <Typography color="error">{timeSlotError}</Typography>}
      </FormControl>
      <TextField
        fullWidth
        label="Medical History"
        value={medicalHistory}
        onChange={(e) => setMedicalHistory(e.target.value)}
        margin="normal"
      />
      <TextField
        fullWidth
        label="Symptoms"
        value={symptoms}
        onChange={(e) => setSymptoms(e.target.value)}
        margin="normal"
      />
      {bookingError && <Typography color="error">{bookingError}</Typography>}
      <Button
        variant="contained"
        color="primary"
        onClick={handleBookAppointment}
        style={{ marginTop: 20 }}
      >
        BOOK APPOINTMENT
      </Button>
    </div>
  );
};

export default BookAppointment;
